// ProfileList.js 
import React from 'react'; 
import { Link } from 'react-router-dom'; 
 
const profiles = [ 
  { id: 1, name: 'John', age: 30, bio: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.', image: 'https://example.com/john.jpg' }, 
  { id: 2, name: 'Jane', age: 25, bio: 'Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.', image: 'https://example.com/jane.jpg' }, 
  { id: 3, name: 'Alice', age: 35, bio: 'Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.', image: 'https://example.com/alice.jpg' }, 
  { id: 4, name: 'Bob', age: 28, bio: 'Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.', image: 'https://example.com/bob.jpg' }, 
  { id: 5, name: 'Eve', age: 40, bio: 'Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', image: 'https://example.com/eve.jpg' } 
]; 
 
function ProfileList() { 
  return ( 
    <div> 
      <h1>Profiles</h1> 
      <ul> 
        {profiles.map(profile => ( 
          <li key={profile.id}> 
            <Link to={`/profile/${profile.id}`}> 
              <img src={profile.image} alt={profile.name} /> 
              {profile.name} 
            </Link> 
          </li> 
        ))} 
      </ul> 
    </div> 
  ); 
} 
 
export default ProfileList;
